import './HomePage.css';
import {Link} from "react-router-dom";
import { signInWithGoogle } from '../db/firebase';


function Login() {
    return <Link to="/about" class="nav-link">
        <div>
      <button className="button" onClick={signInWithGoogle}><i className="fab fa-google"></i>Sign in with google</button>
    </div>
    </Link>
}


function LandingFrameMessage() {

    return <div className="Landing-Frame-Message" >

        <div className="Landing-Title">
            Speech to Text
        </div>

        <div className="Landing-description">
            Using FireBase to login and record user voice.
        </div>
        <br />
        <LandingPageButton />
    </div>
}


function LandingFrame(){
    return <div className="Landing-Frame" 
    style={{ 
        backgroundImage: "url('/images/landing-page-background.jpg')" }}>
        <LandingFrameMessage />
    </div>
}
function HomePage() {
    return <div>
        <LandingFrame />
        <br/>
    </div>
}
export default HomePage
